035\u0070\u0078\u003b\u000a\u0020\u0020\u0062\u006f\u0078\u002d\u0073\u0068\u0061\u0064\u006f\u0077\u003a\u0020\u0030\u0020\u0035\u0070\u0078\u0020\u0031\u0035\u0070\u0078\u0020\u0031\u0070\u0078\u0020\u0072\u0067\u0062\u0061\u0028\u0030\u002c\u0020\u0030\u002c\u0020\u0030\u002c\u0020\u0030\u002e\u0031\u0029\u003b\u000a\u0020\u0020\u006f\u0076\u0065\u0072\u0066\u006c\u006f\u0077\u003a\u0020\u0068\u0069\u0064\u0064\u0065\u006e\u003b\u000a\u007d\u000a\u000a\u002e\u0063\u0061\u0072\u0064\u003a\u0062\u0065\u0066\u006f\u0072\u0065\u0020\u007b\u000a\u0020\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003a\u0020\u0022\u0022\u003b\u000a\u0020\u0020\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0061\u0062\u0073\u006f\u006c\u0075\u0074\u0065\u003b\u000a\u0020\u0020\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0020\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0032\u0037\u0030\u0070\u0078\u003b\u000a\u0020\u0020\u0074\u006f\u0070\u003a\u0020\u0030\u003b\u000a\u0020\u0020\u006c\u0065\u0066\u0074\u003a\u0020\u0030\u003b\u000a\u0020\u0020\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u002d\u0069\u006d\u0061\u0067\u0065\u003a\u0020\u006c\u0069\u006e\u0065\u0061\u0072\u002d\u0067\u0072\u0061\u0064\u0069\u0065\u006e\u0074\u0028\u0074\u006f\u0020\u0074\u006f\u0070\u002c\u0020\u0023\u0030\u0030\u0030\u0030\u0030\u0030\u002c\u0020\u0023\u0041\u0046\u0041\u0041\u0041\u0043\u0029\u003b\u000a\u0020\u0020\u0063\u006c\u0069\u0070\u002d\u0070\u0061\u0074\u0068\u003a\u0020\u0063\u0069\u0072\u0063\u006c\u0065\u0028\u0034\u0030\u0030\u0070\u0078\u0020\u0061\u0074\u0020\u0035\u0030\u0025\u0020\u002d\u0034\u0038\u002e\u0035\u0025\u0029\u003b\u000a\u007d\u000a\u000a\u002e\u0068\u0065\u0061\u0064\u0065\u0072\u0020\u007b\u000a\u0020\u0020\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0072\u0065\u006c\u0061\u0074\u0069\u0076\u0065\u003b\u000a\u0020\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0032\u0036\u0035\u0070\u0078\u003b\u000a\u007d\u000a\u000a\u002e\u006d\u0061\u0069\u006c\u0020\u007b\u000a\u0020\u0020\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0061\u0062\u0073\u006f\u006c\u0075\u0074\u0065\u003b\u000a\u0020\u0020\u0074\u006f\u0070\u003a\u0020\u0031\u0072\u0065\u006d\u003b\u000a\u0020\u0020\u0072\u0069\u0067\u0068\u0074\u003a\u0020\u0032\u0072\u0065\u006d\u003b\u000a\u0020\u0020\u0066\u006f\u006e\u0074\u002d\u0073\u0069\u007a\u0065\u003a\u0020\u0031\u002e\u0035\u0072\u0065\u006d\u003b\u000a\u0020\u0020\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0023\u0046\u0041\u0046\u0033\u0046\u0036\u003b\u000a\u0020\u0020\u006f\u0070\u0061\u0063\u0069\u0074\u0079\u003a\u0020\u0030\u002e\u0038\u003b\u000a\u0020\u0020\u0074\u0072\u0061\u006e\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0030\u002e\u0033\u0073\u003b\u000a\u0020\u0020\u007a\u002d\u0069\u006e\u0064\u0065\u0078\u003a\u0020\u0033\u003b\u000a\u0020\u0020\u0074\u0065\u0078\u0074\u002d\u0064\u0065\u0063\u006f\u0072\u0061\u0074\u0069\u006f\u006e\u003a\u0020\u006e\u006f\u006e\u0065\u003b\u000a\u007d\u000a\u000a\u002e\u006d\u0061\u0069\u006c\u003a\u0068\u006f\u0076\u0065\u0072\u0020\u007b\u000a\u0020\u0020\u006f\u0070\u0061\u0063\u0069\u0074\u0079\u003a\u0020\u0031\u003b\u000a\u007d\u000a\u000a\u002e\u0068\u0061\u006d\u0062\u0075\u0072\u0067\u0065\u0072\u002d\u006d\u0065\u006e\u0075\u0020\u007b\u000a\u0020\u0020\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0061\u0062\u0073\u006f\u006c\u0075\u0074\u0065\u003b\u000a\u0020\u0020\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0032\u0031\u0070\u0078\u003b\u000a\u0020\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0036\u0070\u0078\u003b\u000a\u0020\u0020\u0074\u006f\u0070\u003a\u0020\u0031\u002e\u0034\u0072\u0065\u006d\u003b\u000a\u0020\u0020\u006c\u0065\u0066\u0074\u003a\u0020\u0031\u002e\u0039\u0072\u0065\u006d\u003b\u000a\u0020\u0020\u007a\u002d\u0069\u006e\u0064\u0065\u0078\u003a\u0020\u0033\u003b\u000a\u0020\u0020\u0063\ 069\u006f\u0020\u007b\u000a\u0020\u0020\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u003a\u0020\u0037\u0070\u0078\u0020\u0030\u003b\u000a\u0020\u0020\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0020\u0020\u0062\u006f\u0072\u0064\u0065\u0072\u003a\u0020\u0032\u0070\u0078\u0020\u0073\u006f\u006c\u0069\u0064\u0020\u0023\u0034\u0066\u0061\u0063\u0066\u0065\u003b\u000a\u0020\u0020\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0023\u0032\u0037\u0035\u0036\u0037\u0046\u003b\u000a\u0020\u0020\u0074\u0065\u0078\u0074\u002d\u0064\u0065\u0063\u006f\u0072\u0061\u0074\u0069\u006f\u006e\u003a\u0020\u006e\u006f\u006e\u0065\u003b\u000a\u0020\u0020\u0074\u0065\u0078\u0074\u002d\u0061\u006c\u0069\u0067\u006e\u003a\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0020\u0020\u0066\u006f\u006e\u0074\u002d\u0073\u0069\u007a\u0065\u003a\u0020\u0030\u0072\u0065\u006d\u003b\u000a\u0020\u0020\u006c\u0065\u0074\u0074\u0065\u0072\u002d\u0073\u0070\u0061\u0063\u0069\u006e\u0067\u003a\u0020\u0030\u0070\u0078\u003b\u000a\u0020\u0020\u0074\u0065\u0078\u0074\u002d\u0074\u0072\u0061\u006e\u0073\u0066\u006f\u0072\u006d\u003a\u0020\u0075\u0070\u0070\u0065\u0072\u0063\u0061\u0073\u0065\u003b\u000a\u0020\u0020\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u006c\u0065\u0066\u0074\u003a\u0020\u0030\u0070\u0078\u003b\u000a\u0020\u0020\u0062\u006f\u0072\u0064\u0065\u0072\u002d\u0072\u0061\u0064\u0069\u0075\u0073\u003a\u0020\u0031\u0030\u0030\u0070\u0078\u003b\u000a\u007d\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u000a\u002e\u006d\u006f\u0064\u0061\u006c\u0020\u007b\u000a\u0020\u0020\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0066\u0069\u0078\u0065\u0064\u003b\u000a\u0020\u0020\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0020\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0030\u0030\u0076\u0068\u003b\u000a\u0020\u0020\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0072\u0067\u0062\u0061\u0028\u0030\u002c\u0020\u0030\u002c\u0020\u0030\u002c\u0020\u0030\u002e\u0038\u0029\u003b\u000a\u0020\u0020\u007a\u002d\u0069\u006e\u0064\u0065\u0078\u003a\u0020\u002d\u0031\u003b\u000a\u0020\u0020\u006f\u0070\u0061\u0063\u0069\u0074\u0079\u003a\u0020\u0030\u003b\u000a\u0020\u0020\u0074\u0072\u0061\u006e\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0030\u002e\u0035\u0073\u003b\u000a\u007d\u000a\u000a\u000a\u002e\u006d\u006f\u0064\u0061\u006c\u0020\u0069\u006d\u0067\u0020\u007b\u000a\u0020\u0020\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0061\u0062\u0073\u006f\u006c\u0075\u0074\u0065\u003b\u000a\u0020\u0020\u0074\u006f\u0070\u003a\u0020\u0032\u0035\u0025\u003b\u000a\u0020\u0020\u006c\u0065\u0066\u0074\u003a\u0020\u0035\u0030\u0025\u003b\u000a\u0020\u0020\u0074\u0072\u0061\u006e\u0073\u0066\u006f\u0072\u006d\u003a\u0020\u0074\u0072\u0061\u006e\u0073\u006c\u0061\u0074\u0065\u0028\u002d\u0035\u0030\u0025\u002c\u0020\u002d\u0035\u0030\u0025\u0029\u0020\u0073\u0063\u0061\u006c\u0065\u0028\u0030\u002e\u0033\u0029\u003b\u000a\u0020\u0020\u006d\u0061\u0078\u002d\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0020\u0020\u006d\u0061\u0078\u002d\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0020\u0020\u0074\u0072\u0061\u006e\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u002e\u0035\u0073\u003b\u000a\u007d\u000a\u000a\u000a\u002e\u006d\u006f\u0064\u0061\u006c\u002e\u0073\u0068\u006f\u0077\u0020\u007b\u000a\u0020\u0020\u006f\u0070\u0061\u0063\u0069\u0074\u0079\u003a\u0020\u0031\u003b\u000a\u0020\u0020\u007a\u002d\u0069\u006e\u0064\u0065\u0078\u003a\u0020\u0039\u0039\u003b\u000a\u007d\u000a\u000a\u002e\u006d\u006f\u0064\u0061\u006c\u002e\u0073\u0068\u006f\u0077\u0020\u0069\u006d\u0067\u0020\u007b\u000a\u0020\u0020\u0074\u006f\u0070\u003a\u0020\u0035\u0030\u0025\u003b\u000a\u0020\u0020\u0074\u0072\u0061\u006e\u0073\u0066\u006f\u0072\u006d\u003a\u0020\
